        public string[] _SelectedBearings
        {
            get
            {
                return SelectedBearings;
            }            
        }
        string[] SelectedBearings = new string[0];
        string[] sMindex = new string[0];

        double SelectedFTF = 0;
        double SelectedBSF = 0;
        double SelectedBPO = 0;
        double SelectedBPI = 0;
        int NumberOfBalls = 0;
        public void GetBearings(string Manufacturer)
        {
            string Mindex = null;
            try
            {
                if (Manufacturer != "ALL")
                {
                    for (int i = 0; i < ManufacturerName.Length; i++)
                    {
                        string sUCManName = ManufacturerName[i].ToString().ToUpper();
                        string sUCSelectedManName = Manufacturer.ToUpper();
                        
                        if (sUCManName.ToString().Contains(sUCSelectedManName))
                        {
                            Mindex += "," + i.ToString();
                        }
                    }
                    sMindex = Mindex.Split(new string[] { "," }, StringSplitOptions.RemoveEmptyEntries);
                    SelectedBearings = new string[sMindex.Length];

                    for (int i = 0; i < sMindex.Length; i++)
                    {
                        SelectedBearings[i] = BearingName[Convert.ToInt32(sMindex[i].ToString())].ToString().TrimStart(new char[] { '\t' });
                        SelectedBearings[i] = SelectedBearings[i].ToString().TrimEnd(new char[] { '\t' });
                    }
                }
                else
                {
                    SelectedBearings = new string[ManufacturerName.Length];
                    for (int i = 0; i < ManufacturerName.Length; i++)
                    {
                        SelectedBearings[i] = BearingName[i].ToString().TrimStart(new char[] { '\t' });
                        SelectedBearings[i] = SelectedBearings[i].ToString().TrimEnd(new char[] { '\t' });
                    }
                }
            }
            catch (Exception ex)
            {

            }
        }

        public void GetBearingData(string BearingNumber)
        {
            int Bindex = 0;
            try
            {
                for (int i = 0; i < BearingName.Length; i++)
                {
                    string DatabaseBearing = BearingName[i].ToString().TrimEnd(new char[] { '\t' });
                    DatabaseBearing = DatabaseBearing.TrimStart(new char[] { '\t' });
                    if (DatabaseBearing.ToString()==BearingNumber.ToString())
                    {
                        Bindex = i;
                        break;
                    }
                    
                }
                SelectedBPI = (double)BPFI[Bindex];
                SelectedBPO = (double)BPFO[Bindex];
                SelectedBSF = (double)BSF[Bindex];
                SelectedFTF = (double)FTF[Bindex];
                NumberOfBalls = (int)Balls[Bindex];
            }
            catch (Exception ex)
            {
            }
        }
        public double _FTF
        {
            get
            {
                return SelectedFTF;
            }
